import styled from "styled-components";

export const components = styled.div`
.memo{
    color: #fff;
    display: flex;
   justify-content: space-between;
   margin-bottom:10px
}
.background{

    background-color: #bcb8b1;
    height: auto;
    max-width: 650px;
    width: auto;
    margin: 0px auto 45px;
    }
`
